import { InputStyle } from "./inputStyle";

export default function Input() {
  const handleSubmit = (event: any) => {
    event.preventDefault();

    alert(event.target.value);
  };

  return (
    <InputStyle>
      <input type="text" onChange={handleSubmit} name="task" id="" />
    </InputStyle>
  );
}
